import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the sort/filter controls by label text
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Find the List View button using its title attribute (different from previous attempts)
    const listViewBtn = await page.waitForSelector('button[title="List View"]', { timeout: 5000 });

    // Take screenshot before switching
    const beforeSwitchShot = path.join(screenshotsDir, 'step_2_before_listview.png');
    await page.screenshot({ path: beforeSwitchShot });
    screenshots.push(beforeSwitchShot);

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (unique to list view)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching
    const afterSwitchShot = path.join(screenshotsDir, 'step_3_after_listview.png');
    await page.screenshot({ path: afterSwitchShot });
    screenshots.push(afterSwitchShot);

    // Extract the number of product cards in list view for verification
    const productCardCount = await page.$$eval('.products-list .product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View mode by clicking the List View button",
      extractedData: {
        productCardCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
